这是一个简单的Python计算器实现，支持加、减、乘、除四种基本运算：

```python
def calculator():
    while True:
        operation = input("请输入你要进行的运算（+ - * /，或输入'quit'退出）：")
        if operation.lower() == 'quit':
            break
        num1 = float(input("请输入第一个数字："))
        num2 = float(input("请输入第二个数字："))
        if operation == '+':
            result = num1 + num2
        elif operation == '-':
            result = num1 - num2
        elif operation == '*':
            result = num1 * num2
        elif operation == '/':
            if num2 != 0:  # 防止除以零
                result = num1 / num2
            else:
                print("错误：除数不能为零")
                continue
        else:
            print("错误：无效的运算符")
            continue

        print(f"{num1} {operation} {num2} = {result}")

calculator()
```

这个程序会持续运行，直到用户输入'quit'为止。它会提示用户输入运算符和两个数字，然后计算并打印结果。如果用户输入了无效的运算符，或者试图除以零，程序会给出相应的错误提示。

