def first_uniq_char(s):
    char_count = {}
    for i, char in enumerate(s):
        if char not in char_count:
            char_count[char] = 1
        else:
            char_count[char] += 1
    for i, char in enumerate(s):
        if char_count[char] == 1:
            return i
    return -1  # If all characters are unique, return -1

