def sliding_average(data_stream, window_size):
    averages = []
    window_sum = 0

    for i, data in enumerate(data_stream):
        window_sum += data

        if i >= window_size:
            window_sum -= data_stream[i - window_size]

        if i >= window_size - 1:
            average = window_sum / window_size
            averages.append(average)

    return averages

