def bubble_sort(arr):
    n = len(arr)
    for i in range(n):
        for j in range(0, n-i-1):
            if arr[j] > arr[j+1]:
                arr[j], arr[j+1] = arr[j+1], arr[j]
    return arr
```

这个函数接受一个数组作为参数，然后使用两个嵌套的循环来比较相邻的元素，如果前一个元素大于后一个元素，则交换它们的位置。这个过程会重复进行n-1次，直到整个数组被排序。最后，函数返回已排序的数组。

