当然，以下是Python中简单的冒泡排序算法实现：

```python
def bubble_sort(arr):
    n = len(arr)
    for i in range(n-1):
        # 遍历所有数组元素
        for j in range(0, n-i-1):
            # 如果当前元素大于下一个元素，交换它们
            if arr[j] > arr[j+1]:
                arr[j], arr[j+1] = arr[j+1], arr[j]
    return arr
```

这个函数接受一个列表作为输入，然后通过嵌套的for循环遍历列表，如果相邻元素顺序错误（这里假设是降序），就交换它们。重复这个过程，直到列表完全排序。
